  }
`;

const NavbarContent = styled.div`
  width: 100%;

  .Navbar_ul {
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: space-evenly;
    list-style: none;

    .NavContentContainer {
      display: flex;
      flex-direction: column;
      align-items: center;
      justify-content: center;
      padding: 3px;
      margin: 5px;
      width: 100%;

      a {
        text-decoration: none;
        color: #472d2d;
        font-size: 1.2rem;
        padding: 2px;
        box-sizing: border-box;
        width: 100%;
        letter-spacing: 0.3px;

        .Navbar_li {
          font-family: "Alkatra", cursive;
          padding: 2px;
          margin: 2px;
          cursor: pointer;
          border-radius: 4px;
          text-align: center;
          background-color: white;
          width: 100%;
          box-sizing: border-box;
        }
      }

      /* css for inner option */

      .InnerOptions {
        position: absolute;
        top: 75%;
        width: 21%;
        display: flex;
        flex-direction: column;
        align-items: flex-start;
        justify-content: center;
        color: #472d2d;
        box-shadow: rgba(0, 0, 0, 0.1) 0px 2px 4px,
          rgba(0, 0, 0, 0.1) 0px 8px 16px;
        border-radius: 5px;
        background-color: white;
        
        

        .InnerOptions_a {
          width: 100%;
          /* border: 2px solid purple; */
          box-sizing: border-box;
          .InnerOptions_li {
            /* border: 2px solid pink; */
            width: 100%;
            box-sizing: border-box;
            font-family: "Alkatra", cursive;
            font-size: 1.1rem;
            padding: 2px;
          }
        }
      }
    }
  }
`;
